class Solution {
public:
    int rec(int ind,string &s,set<string>&st,vector<int>&dp)
    {
        if (ind==s.size()) return 0;
        if (dp[ind]!=-1) return dp[ind];
        int ans=s.size()-ind;
        for (int i=ind;i<s.size();i++)
        {
           string temp=s.substr(ind,i-ind+1);
           if (st.find(temp)!=st.end())
           {
              ans=min(ans,rec(i+1,s,st,dp));
           }
        }
        ans=min(ans,rec(ind+1,s,st,dp));
        return dp[ind]=ans;
    }
    int minExtraChar(string s, vector<string>& dictionary) 
    {
        set<string>st;
        int n=s.size();
        vector<int>dp(n+1,-1);
        for (auto it:dictionary)
        {
            st.insert(it);
        }
        return rec(0,s,st,dp);
    }
};
```
The function rec is the recursive function where we want to find out the minimum number of extra characters to be left over after breaking up the string 's'. The parameter ind is the starting index of the substring.

First, we check if the current index 'ind' is the end of the string 's', if so return 0. We initialize ans as the size of the string minus the current index 'ind'. 

Then, we loop through the string 's' from the current index 'ind' to the end. For each substring from the current index to the loop index 'i', we check if it is present in the set dictionary. If it is, we try to break the rest of the string starting from the next index 'i+1' and update the answer.

Finally, we return the minimum between the current answer and the result of breaking the rest of the string starting from the next index 'ind+1' (when we decide not to use the current substring).
